import React from "react";
import { Card, CardContent } from "./ui/Card";
import { LineChart, Line, XAxis, YAxis, Tooltip, ResponsiveContainer } from "recharts";

const fillLevelData = [
  { time: "Week 1", level: 60 },
  { time: "Week 2", level: 25 },
  { time: "Week 3", level: 90 },
  { time: "Week 4", level: 65 },
  { time: "Week 5", level: 30 },
  { time: "Week 6", level: 85 },
  { time: "Week 7", level: 100 },
];

export function FillLevelChart() {
  return (
    <Card>
      <CardContent className="p-4">
        <h2 className="font-semibold text-lg mb-2">Fill-Level Over Time</h2>
        <ResponsiveContainer width="100%" height={200}>
          <LineChart data={fillLevelData}>
            <XAxis dataKey="time" stroke="#ccc" />
            <YAxis stroke="#ccc" />
            <Tooltip />
            <Line type="monotone" dataKey="level" stroke="#00bcd4" strokeWidth={2} />
          </LineChart>
        </ResponsiveContainer>
      </CardContent>
    </Card>
  );
}
